import NavHeader from './componenents/navHeader';
import Cards from './componenents/cards';
import Carousel from './componenents/carousel';
import Promo from "./componenents/promo";
function App() {
  return (
    <div className="App">
      <Promo/>
      <NavHeader />
      <Cards />
      <Carousel />
    </div>
  );
}

export default App;
